  summary: "\nA data element is a submodel element that is not further composed out of\nother submodel elements.\n"
  remarks: "\n<p>\nA data element is a submodel element that has a value. The type of value differs\nfor different subtypes of data elements.\n</p>\n<p>\nConstraints:\n</p>\n<ul>\n<li>\n<p>\nConstraint AASd-090:\nFor data elements <see cref=\"!:Aas.IDataElement.Category\"></see> shall be one of the following\nvalues: <code>CONSTANT</code>, <code>PARAMETER</code> or <code>VARIABLE</code>.\n</p>\n<p>\nDefault: <code>VARIABLE</code>\n</p>\n</li>\n</ul>\n"
